PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX enc: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#Encounter>
PREFIX rc: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#reasonCode>
PREFIX rd: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#reasonDescription>

SELECT ?reasonCode ?reasonDescription
WHERE {
  ?enc rdf:type enc:Encounter ;
       enc:id "79942d67-05c5-5c61-336d-4be332d76720" ;
       rc:code ?reasonCode ;
       rd:description ?reasonDescription .
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX snomed: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#snomed:SNOMED-CT>
PREFIX uuid: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#urn:uuid>
PREFIX cvx: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#hl7:CVX>
PREFIX ct: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#umls:RxNorm>
PREFIX loinc: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#loinc:LOINC>

SELECT ?diagnosis1 ?diagnosis2 ?diagnosis3 ?diagnosis4
WHERE {
  ?claim rdf:type Claim .
  ?claim uuid:id "68140758-17f3-541c-8d04-e2d06b91e442" .
  OPTIONAL { ?claim loinc:diagnosis1 ?diagnosis1 }
  OPTIONAL { ?claim loinc:diagnosis2 ?diagnosis2 }
  OPTIONAL { ?claim loinc:diagnosis3 ?diagnosis3 }
  OPTIONAL { ?claim loinc:diagnosis4 ?diagnosis4 }
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX enc: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#Encounter>
PREFIX pay: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#Payer>

SELECT ?payer
WHERE {
  ?enc rdf:type enc:Encounter ;
       enc:id "148005b7-cfc4-feb7-9860-3d2afde95c82"^^xsd:string ;
       pay:encounter ?payer .
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX synthea: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT (COUNT(DISTINCT ?encounter) AS ?uncovered_encounters)
WHERE {
  ?payer synthea:Encounter ?encounter .
  ?encounter a synthea:Encounter .
  ?payer synthea:id "e03e23c9-4df1-3eb6-a62d-f70f02301496"^^rdf:UUID .
  FILTER NOT EXISTS {
    ?encounter synthea:payer ?payer_coverage .
    ?payer_coverage synthea:amount_covered > 0 .
  }
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
