PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX synthea: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>

SELECT (COUNT(DISTINCT e) AS ?uncoveredEncounters)
WHERE {
  ?payer synthea:Payer#id "Medicare" .
  ?encounter synthea:Encounter#payer ?payer .
  ?encounter synthea:Encounter#id ?e .
  FILTER NOT EXISTS {
    ?claim synthea:Claim#encounter ?encounter .
    ?claim synthea:Claim#payerCoverage pl:true .
  }
}

